import 'bootstrap/dist/css/bootstrap.min.css';
import Search from './components/Search/Search';
import Offers from './components/Offers/Offers';
import newsOffers from './components/Offers/newsOffers';
function App() {
  return (
    <div className="App">
      <Navbar />
      <Search />
      <Offers />
    </div>
  );
}

export default App;
